import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import App from './App';

const root = ReactDOM.createRoot(document.getElementById('root'));

setTimeout(() => {
    root.render(
        <React.StrictMode>
            <App />
        </React.StrictMode>
    );
}, 1000);
